import { NavLink } from "react-router-dom";
import "./Header.css";
import Logo from "../Ui/Icons/Logo";
import FlagUS from "../Ui/Icons/FlagUS";
import SelectSvg from "../Ui/Icons/SelectSvg";
import navItem from "../../assets/navItem.svg";
import { useState } from "react";
import CloseIcon from "../Ui/Icons/CloseIcon";

const Header = () => {
  const [active, setActive] = useState(false);

  const clickHandler = () => {
    setActive(!active);
  };

  return (
    <header className="home_page_header">
      <div className="container">
        <Logo />
        <nav>
          {active ? (
            <CloseIcon onClick={clickHandler} />
          ) : (
            <img
              src={navItem}
              alt=""
              onClick={clickHandler}
              className="NavMenuIcon"
              width="50px"
              height="50px"
            />
          )}
          <ul className={`header_nav_ul ${active ? "active" : ""}`}>
            <li>
              <NavLink to={"/"}>Home</NavLink>
            </li>
            <li>
              <NavLink to={"/"}>
                Auction <SelectSvg />
              </NavLink>
            </li>
            <li>
              <NavLink to={"/"}>Logo In</NavLink>
            </li>
            <li>
              <NavLink to={"/"}>Register</NavLink>
            </li>
            <li>
              <NavLink to={"/"}>
                <FlagUS />
                Eng
                <SelectSvg />
              </NavLink>
            </li>
            <li>
              <NavLink to={"/"}>
                05:07 <SelectSvg />
              </NavLink>
            </li>
            <li>
              <NavLink to={"/"}>Contac Us</NavLink>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
